Lists are similar to dynamic arrays in other programming languages. A list is declared by putting comma separated elements inside of [ and ]. The # operator is used to get the length of a list. Lists are indexed from 0. The size of lists can change at runtime. Indexing a list with an invalid index (-1 or a value greater than it's length) will throw an error. let arr = [1, 2, 3]
for el in arr { print(el)
} Common methods and functions on lists : list:push(item): Appends item to the end of the list. list:pop(): Removes the last item from the list and returns it. len(list): Returns the length of the list. list:map(fn): Creates a new list ls where ls[i] is fn(list[i]) For more methods and free functions to operate on lists, refer to the standard library documentation.

