Tables can have properties that are functions. Functions can either be invoked normally by accessing them or by using the : operator. When called using :, the functions behave as methods. const cat = { sound: 'meow' speak: fn (self) { print(self.sound) }
} cat:speak() -- 'meow'
cat.speak(cat) -- 'meow' Note that table:method() is equivalent to table.method(table). Methods have an extra first parameter that refers to the table itself. By convention, this parameter is called 'self'. But any other name also suffices.

21.body:
To make methods look more natural and convenient, there exists a short-hand syntax. const dog = { sound: 'woof!', speak() { print(self.sound) }
} dog:bark() -- woof!
dog.bark(dog) -- woof! -- Can also be called like a free function
-- on other objects.
dog.bark(cat) -- meow The self parameter is implicit and hidden when a method is defined with the shorthand syntax.

23.body:
Equipped with the knowledge of prototypes and methods , we are now ready to explore vyse's object oriented programming capabilities. To demonstrate, we will start off by designing a simple 2D Vector class. For now, let's just assume the following simple features: Create a 2D vector with Vec2:make(x, y) Access x and y properties as v.x and v.y. Calculate a vector's magnitude with v:mag(). const Vec2 = { make(x, y) { const v = {x: x, y: y} setproto(v, self) return v } mag() { return math.sqrt(self.x ** 2 + self.y ** 2) }
} Writing simple tests for the vector class doesn't take a lot of effort. let pt = Vec2:make(2, 3) -- 1
assert(pt.x == 2 and pt.y == 3) -- 2
assert(pt:mag() == 13) -- 3 The assert builtin throws an error if the first argument is falsy (either false or nil). Given the implementation of Vec2 class we described, the above assertions should pass. Vec2 is a table with 2 member functions, make and mag. The make method first creates an empty table v and sets it's x and y fields to the provided parameters. Next, the prototype of x is set to Vec2 itself. We then create pt, an 'instance' of Vec2 (line 1). The table pt itself doesn't have any immediate member called 'mag', so when the lookup is performed for a method with the name mag in line 3, the mag method from the original Vec2 class is instead used.

24.body:
Inheritance can similarly be modelled with prototypes and the setproto builtin. Imagine you're writing code for your command line roguelike game. const Enemy = { make(x, y, hp) { const e = {} e.pos = Vec2:make(x, y) e.hp = hp return setproto(e, self) } log() { print(self.pos.x, self.pos.y) }
} This table is now ready to serve as our base enemy class that other classes can derive from. An enemy is capable of holding some data and displaying it's position. const Goblin = { make(x, y, hp, dmg) { const gob = Enemy:make(x, y, hp) gob.damage = dmg return setproto(gob, self) } attack(target) { print("stole ", damage, "gold from", target) }
} setproto(Goblin, Enemy) The call to setproto on the last line sets Goblin's base class (prototype) to Enemy. const spleen = Goblin(0, 0, 10, 2)
spleen:log() -- 0 0 spleen:attack('squee') -- stole 2 gold from squee Our character spleen is now able to exhibit the behavior of both an Enemy and a Goblin. This simple object modelling strategy can be expanded to multiple facets of software architecture in Vyse.

26.body:
Let us recollect the implementation of a simple Vector class defined earlier . const Vec2 = { make(x, y) { const v = {x: x, y: y} setproto(v, self) return v } mag() { return math.sqrt(self.x ** 2 + self.y ** 2) }
} Vectors are very often used in data visualization and game programming. We would like to include the functionality to add together two vectors. This can very easily be done by attaching a method. fn Vec2.add(a, b) { return Vec2:make(a.x + b.x, a.y + b.y)
} We can now add together vectors by calling this method that behaves like a static member. const a = Vec2:make(1, 2)
const b = Vec2:make(2, 3) const c = Vec2.add(a, b)
print(c.x, c.y) -- 3 5 It is often advantageous to both the programmer and the reader to use the usual mathematical symbols (here +) when defining such constructs. For instance, many would prefer a + b over Vec2.add(a, b). This is made possible in vyse with the help of proto-methods. For the + operator, the __add proto-method is used. fn Vec2.__add(a, b) { return Vec2:make(a.x + b.x, a.y + b.y)
} Once a proto-method is defined on an object's prototype, this is called whenever the event associated with the protomethod is invoked. Now, we can add together vectors with the + operator. (Note that we use Vec2.__add when defining the method instead of :. We do not want any hidden self parameter in the protomethod) const a = Vec2:make(1, 2)
const b = Vec2:make(2, 3) const c = a + b
print(c.x, c.y) -- 3 5

